If BlueScope wished to persuade me that it truly required the contentious documents in order to understand the issues raised in the arbitration, it should have tendered in evidence on the present application the documents which it already has and demonstrated to my satisfaction that those documents did not enable it fairly to present its case for a stay or summary dismissal. In that way it may have been able to persuade me that the evidentiary material which it seeks is reasonably likely to add, in the end, in some way or other, to the relevant evidence to be adduced in support of the relief which it claims in its Motion. It did not take this course. The onus was on BlueScope to establish the apparent relevance of the contentious documents in the sense explained by Sackville J in Seven Network Ltd v News Ltd (No 11) [2006] FCA 174 at [6] . It has failed to discharge that onus. It does not contend that it requires the contentious documents for the purposes of understanding the issues in the arbitration. It confined its attention to potential overlaps in the evidence. On the evidence before me, the Notice to Produce cannot be supported on the grounds upon which BlueScope seeks to support it.  In Seven Network Ltd v News Ltd (No 11) [2006] FCA 174 at [6] , his Honour said: It is now established that lack of apparent relevance is a ground for setting aside a subpoena or notice to produce: Trade Practices Commission v Arnotts Ltd (1989) 88 ALR 90 at 101-103, per Beaumont J. In an earlier interlocutory judgment delivered in these proceedings, I said that the test of apparent relevance is whether the documents are 'reasonably likely to add, in the end, in some way or other, to the relevant evidence in the case': Seven Network Ltd v News Ltd (No 5) , at [10], citing Spencer Motors Pty Ltd v LNC Industries Ltd [1982] 2 NSWLR 921 at 927, per Waddell J. Neither party disputes that this is the appropriate test.  It was submitted on behalf of CKI that: 
(a) The Court should apply an appropriate test of relevance in determining whether or not the Notice to Produce should be set aside. That test is "... whether the documents sought in the Notice are reasonably likely to add, in the end, in some way or other, to the relevant evidence in the case" ( Seven Network Ltd v News Ltd (No 5) [2005] FCA 510 ; (2005) 216 ALR 147 at [5] ---[12]; and Seven Network Ltd v News Ltd (No 11) [2006] FCA 174) ; 

(b) In the circumstances of the present case, the documents are not likely, in the end, to add to the relevant evidence in the case. The "case" to which the documents must be relevant is the claim for relief made by BlueScope in its Notice of Motion filed on 7 July 2010. In other words, the documents must be likely to add relevantly to BlueScope's claim that the proceedings should be stayed or summarily dismissed;

(c) The contentious documents are not necessary in order to enable BlueScope fairly to present its case for summary relief nor are they likely to add in any meaningful way to the relevant material which the Court will be called upon to consider when dealing with BlueScope's claim that the proceedings should be stayed or summarily dismissed.
